import React from 'react'
import {FaBars,FaTimes} from 'react-icons/fa'

const Navbar = () => {
  return (
    <div className='fixed w-full h-[80px] flex item-center justify-between bg-[#0a192f] text-gray-300'>
      {/* Logo goes here */}
      <div>
        <h1>Moavia hassan</h1>
      </div>
    </div>
  )
}

export default Navbar
